const INITIAL_STATE = {
  email: '',
  password: '',
};

function loginReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
  case 'ADD_LOGIN': return {
    ...state,
  };
  }
}

export default loginReducer;
